  afterload_start: function() {
    dataparam = [];
    jQuery(".afterload").each(function(index, element) {
      element = jQuery(element);
      dataparam.push(element.attr("id"));
    });

    if (!dataparam.length) {
      sh.afterloaded_init();
      return;
    }
    jQuery.post(
      wpData.afterload_url,
      {
        modules: dataparam,
        id: wpData.post_id
      },
      function(response) {
        if (typeof response.modules !== "object") return;
        for (var key in response.modules) {
          if (response.modules[key] == undefined) continue;
          var container = jQuery("#" + key);
          var content = jQuery(response.modules[key]);
          content.first().addClass("afterloaded");
          container.after(content);
          container.remove();
        }
        sh.afterloaded_init();
      }
    );
  },

