sh.goals = {
	
	inited : false,
	initedRoistat : false,
	event : '',
	event_default : 'none',
	ym_id : 36049235,
	nomodals : {},

	init : function(){
		if ( wpData.dev == true ) return;
		this.event = this.event_default;
		this.nomodals = jQuery( '.nomodal .wpcf7:not(.nomodal_goal_inited)' );
			
		this.init_single_clicks();
		this.init_modal_forms();
		this.init_nomodal_forms();
		this.init_mail_sent();
		this.init_phone_click();
		this.init_bottom_phone_click();
		this.init_roistat();
		
		
		this.inited = true;
	},
	
	init_modal_forms : function(){
		jQuery( '.js_act_btn:not(.modal_goal_inited)').each( function( i, elm ){
			jQuery( elm )
			.click( function ( eo ) {
				var goal = jQuery( this ).data( 'modal_form_goal' );
				sh.goals.event = goal || sh.goals.event_default;
			})
			.addClass( 'modal_goal_inited' );
		} );

	},
	
	init_nomodal_forms : function(){
		this.nomodals.each( function( i, elm ){
			elm.addEventListener( 'wpcf7beforesubmit', function( event ){
				var goal = jQuery( elm ).parents( '.nomodal' ).first().data( 'modal_form_goal' )
				sh.goals.event = goal || sh.goals.event_default;
			} );
			elm.classList.add( 'nomodal_goal_inited' );
		} );
	},
	
	init_phone_click : function(){
		jQuery( '.js_click_number:not(.click_number_inited)')
		.click( function () {
			ym( sh.goals.ym_id, 'reachGoal', 'nomer' );
		} )
		.addClass( 'click_number_inited' );
	},

	init_bottom_phone_click : function() {
		jQuery( '[data-js-mobile-bottom-call]:not(.click_number_inited)')
			.click( function (e) {
				ym( sh.goals.ym_id, 'reachGoal', 'Number_down' );
			} )
			.addClass( 'click_number_inited' );
	},
	
	init_mail_sent : function(){
		if ( this.inited ) return;
		document.addEventListener( 'wpcf7mailsent', function( event ) {
			ym( sh.goals.ym_id, 'reachGoal', sh.goals.event );
			//gtag( 'event', sh.goals.event, { 'event_category' : 'sendform' });
			dataLayer.push({'event': sh.goals.event});
			fbq( 'track', 'Lead' );
			
			sh.goals.event = sh.goals.event_default;
		}, false );
	},
	
	init_single_clicks : function(){
		jQuery( '.js_click_goal:not(.click_goal_inited)' ).each( function( index, elm ){
			jQuery( elm )
			.click( function( eo ){
				var event_name = jQuery( this ).data( 'single_click_goal' );
				ym( sh.goals.ym_id, 'reachGoal', event_name );
				dataLayer.push({ 'event': event_name });
			} )
			.addClass( 'click_goal_inited' );
		} )
	},
	
	init_roistat : function(){
		if ( undefined == window.roistat ) return;
		if ( this.initedRoistat ) return;
		window.roistat.leadHunter.onAfterSubmit = function( leadData ){
			ym( sh.goals.ym_id, 'reachGoal', 'lidhunter' );
			dataLayer.push({ 'event': 'lidhunter' });
		}
		this.initedRoistat = true;
	}
};


